input.css:
@color1: white;
@color2: rgb(255, 255, 255);
@color3: rgba(255, 255, 255, 1);
@color4: #ffffFf;
@color5: hsl(120, 65%, 75%);
@color6: hsla(120, 65%, 75%, 1);
@color7: #fff;
@color8: black;
// @color9: black;

@no: 1px;
@white-color: #f3f3f3;

div {
    border: 1px solid hsl(120, 65%, 75%);
    color: hsl(10, 5%, 5%);
    span {
        color: rgb(255, 255, 255);
    }
}

